script: |
  super -f text -I q8765.spq | sort > q8765.out

inputs:
  - name: q8765.spq
    data: |
      SELECT MAX ( - col1 ) * + 76 FROM tab0 (FORMAT parquet) AS cor0 WHERE - col0 * + col1 + + col0 * + col2 / - 30 NOT IN ( + + ( - col1 ) );
  - name: tab0

outputs:
  - name: q8765.out
    data: |
      -76
